import Header from "./Header";
import Slider from "./Slider";
import Skills from "./Skills";
import About from "./About";
import Work from "./Work";
import Footer from "./Footer";
import Contact from "./Contact";
function App() {
    return (
        <div>
            <Header />
            <Slider />
            <About />
            <Skills />
            <Work />
            <Contact />
            <Footer />
        </div>
    );
}

export default App;
